import './index.scss';
import Navbar from '../Navbar';
import { io } from 'socket.io-client';
import { useState, useEffect } from "react";
import {NavLink} from "react-router-dom";

const socket = io();
socket.on('alert', (msg) => {
    alert(msg);
});

const Create = () => {
    const init = (
        <div>
            Loading . . .
        </div>
    );
    const [packs, setPacks] = useState(init);

    return (
        <>
            <Navbar />

            <div className={ 'main' }>
                { packs }
            </div>
        </>
    );
}

export default Create;
